import React from "react";
import { Featured } from "../component/Featured";
import "../style/products.css";
import { Virtual, Navigation } from "swiper/modules";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/navigation";
import items from "../data/Productlist";

export const Product = () => {
  return (
    <div id="prd-page">
      <div id="menu-prd">
        <h3>Categories</h3>
        <ul className="categ">
          <a href="#all">All</a>
          <a href="#t-shirt">T-shirt</a>
          <a href="#hoodie">Hoodie</a>
          <a href="#accessoire">Accessoire</a>
        </ul>
      </div>
      <div id="product-cont">
        <div id="all">
          <h1>All</h1>
          <div className="horizontal-line-prod"></div>
          <div className="all-cont">
            {items[4].map((item, index) => (
              <Featured
                className="swiper-slide"
                id={item.id}
                key={index}
                pic={item.pic}
                title={item.title}
                price={item.price}
                rate={item.rate}
                review={item.review}
              />
            ))}
          </div>
        </div>
        <div id="t-shirt">
          <h1>T-shirt</h1>
          <div className="horizontal-line-prod"></div>
          <div className="sp-cont">
          <Swiper
            modules={[Virtual, Navigation]}
            slidesPerView={4}
            spaceBetween={30}
            navigation={true}
            virtual

            >
            {items[0].map((item, index) => (
              <SwiperSlide virtualIndex={index} className="swipper">
                <Featured
                  className="swiper-slide"
                  id={item.id}
                  key={index}
                  pic={item.pic}
                  title={item.title}
                  price={item.price}
                  rate={item.rate}
                  review={item.review}
                  />
              </SwiperSlide>
            ))}
          </Swiper>
          </div>
          <div className="wrap-prod">
            {items[0].map((item, index) => (
              <Featured
                className="swiper-slide"
                id={item.id}
                key={index}
                pic={item.pic}
                title={item.title}
                price={item.price}
                rate={item.rate}
                review={item.review}
              />
            ))}
          </div>
        </div>
        <div id="hoodie">
          <h1>Hoodies</h1>
          <div className="horizontal-line-prod"></div>
          <div className="sp-cont">
          <Swiper
            modules={[Virtual, Navigation]}
            slidesPerView={4}
            spaceBetween={30}
            navigation={true}
            className="slidswipper"
          >
            {items[1].map((item, index) => (
              <SwiperSlide virtualIndex={index} className="swipper">
                <Featured
                  className="swiper-slide"
                  key={index}
                  pic={item.pic}
                  title={item.title}
                  price={item.price}
                  rate={item.rate}
                  review={item.review}
                />
              </SwiperSlide>
            ))}
          </Swiper>
          </div>
          <div className="wrap-prod">
            {items[1].map((item, index) => (
              <Featured
                className="swiper-slide"
                id={item.id}
                key={index}
                pic={item.pic}
                title={item.title}
                price={item.price}
                rate={item.rate}
                review={item.review}
              />
            ))}
          </div>
        <div id="accessoire">
          <h1>Accessoires</h1>
          <div className="horizontal-line-prod"></div>
          <div className="sp-cont">
          <Swiper
            modules={[Virtual, Navigation]}
            slidesPerView={4}
            spaceBetween={20}
            navigation={true}

          >
            {items[1].map((item, index) => (
              <SwiperSlide virtualIndex={index} className="swipper">
                <Featured
                  className="swiper-slide"
                  key={index}
                  pic={item.pic}
                  title={item.title}
                  price={item.price}
                  rate={item.rate}
                  review={item.review}
                />
              </SwiperSlide>
            ))}
          </Swiper>
          </div>
          <div className="wrap-prod">
            {items[1].map((item, index) => (
              <Featured
                className="swiper-slide"
                id={item.id}
                key={index}
                pic={item.pic}
                title={item.title}
                price={item.price}
                rate={item.rate}
                review={item.review}
              />
            ))}
          </div>
        </div>
      </div>
    </div>
    </div>
  );
};
